È proprio vero che i migliori affari si concludono a tavola. Qui con Elisa stavamo ragionando sull’opportunità di unire una voce cristallina, pura e nordica come la sua, con questa specie di rantolo indefinito e malinconicamente calabro che da anni è il mio segno distintivo. Complice il tasso alcolemico e la mia indubitabile simpatia siamo addivenuti a un accordo. E devo dire che ne sono molto felice. Ascoltatelo e spargete lacrime sui vetri dei vostri cellulari, ché ormai su Instagram non fate altro che ridere, maledetta frivolezza contemporanea! Abbracci paternalistici. 
D.

